import React from "react";

const Ads = () => {
  return (
    <>
      <div className="text-center">
        <img className="w-100" src="/img/png/ads/ad1.png" />
        <img className="mt-4 w-100" src="/img/png/ads/ad2.png" />
      </div>
    </>
  );
};

export default Ads;
